export const getBoxShadow = (colorMode) => {
    const f = `0 20px 25px -5px ${
        colorMode === "light" ? "rgba(0, 0, 0, 0.1)" : "rgba(250, 250, 250, 0.1)"
    },0 10px 10px -5px ${
        colorMode === "light" ? "rgba(0, 0, 0, 0.04)" : "rgba(250, 250, 250, 0.04)"
    }`;

    return f;
};

